import React from 'react'
import Navbar from './../Components/Navbar';
import Footer from './../Components/Footer';
import NewsLetter from './../Components/NewsLetter';
import Announcement from './../Components/Announcement';
import styled from 'styled-components';

const Container = styled.div`
  width: 100%;   
`

const MainContainer = styled.div`
  width: 95%;
  margin: auto;
`

const Title = styled.h1`
  text-align: center;
  font-weight: 100;
`
const ButtonsBar = styled.div`
  display: flex;
  justify-content: space-between;
`
const MiddleButtonBar = styled.div`
  display: flex;
  flex: 1;
  justify-content: space-evenly;
  align-items: center;
`

const ButtonContainer = styled.div`
  flex: 1;
  display: flex;
  justify-content: ${props => props.position === "Right" ? "flex-end" : "flex-start"};
`

const A = styled.a`
  color: black;
  font-weight: bold;
`
const Button = styled.button`
  font-weight: bold;
  background-color: ${props => props.buttonType === "checkout" ? "black" : "transparent"};
  color: ${props => props.buttonType === "checkout" ? "white" : "black"};
  width: 50%;
  height: 40px;
`


const Wrapper = styled.div`
  width: 100%;
  display: flex;
`
const ItemBox = styled.div`
  flex: 3;
`
const Item = styled.div``
const ImgContainer = styled.div``
const Image = styled.div``
const DescContainer = styled.div``
const PriceContainer = styled.div``
const Summary = styled.div`
  flex: 1;
  border: 1px solid lightgray;
  border-radius: 10px;
  height: 50vh;
  display: flex;
  flex-direction: column;
  justify-content: space-evenly;
`
const STitle = styled.h3`
  margin: 0;
  padding: 0;
`
const CalculationRow = styled.div``
const Text = styled.div``


const Cart = () => {
  return (
        <Container>
            <Navbar/>
            <Announcement/>
            <MainContainer>
              <Title>YOUR BAG</Title>
              <ButtonsBar>
                <ButtonContainer position={"Left"}>
                <Button buttonType={"shopping"}>CONTINUE SHOPPING</Button>
                </ButtonContainer>
                <MiddleButtonBar>
                  <A href="#">Shopping Bag(2)</A>
                  <A href="#">Your Wishlist(0)</A>
                </MiddleButtonBar>
                <ButtonContainer position={"Right"}>
                <Button buttonType={"checkout"}>CHECKOUT NOW</Button>
                </ButtonContainer>
              </ButtonsBar>
              <Wrapper>
                <ItemBox>
                  <Item>
                    <ImgContainer>
                      <Image src="https://i.pinimg.com/originals/2d/af/f8/2daff8e0823e51dd752704a47d5b795c.png"/>
                    </ImgContainer>
                    <DescContainer></DescContainer>
                    <PriceContainer></PriceContainer>
                  </Item>
                  <Item>
                    <ImgContainer>
                      <Image src="https://hips.hearstapps.com/vader-prod.s3.amazonaws.com/1614188818-TD1MTHU_SHOE_ANGLE_GLOBAL_MENS_TREE_DASHERS_THUNDER_b01b1013-cd8d-48e7-bed9-52db26515dc4.png?crop=1xw:1.00xh;center,top&resize=480%3A%2A"/>
                    </ImgContainer>
                    <DescContainer></DescContainer>
                    <PriceContainer></PriceContainer>
                  </Item>
                </ItemBox>
                <Summary>
                  <STitle>ORDER SUMMARY</STitle>
                  <CalculationRow>
                    <Text>Subtotal</Text>
                    <Text>$50</Text>
                  </CalculationRow>
                  <CalculationRow>
                    <Text>Estimated Shipping</Text>
                    <Text>$3.0</Text>
                  </CalculationRow>
                  <CalculationRow>
                    <Text>Shopping Discount</Text>
                    <Text>$7</Text>
                  </CalculationRow>
                  <Button buttonType={"checkout"}>CHECKOUT NOW</Button>
                </Summary>
              </Wrapper>
            </MainContainer>
            <NewsLetter/>
            <Footer/>
        </Container>
  )
}

export default Cart
